// Retrieve the input data from node "JSON"
let inputData = $node["JSON"].json;

// If input is an array, use the first item
if (Array.isArray(inputData)) {
  inputData = inputData[0];
}

// Access query object directly (it's not an array!)
const paramsData = inputData.query;

// Base URL for Apollo
const baseURL = 'https://app.apollo.io/#/people';

// Array to hold query string parts
const queryParts = [];

// Add static params
queryParts.push('sortByField=recommendations_score');
queryParts.push('sortAscending=false');
queryParts.push('page=1');

// Helper to handle array parameters
const addArrayParams = (paramName, values) => {
  values.forEach(val => {
    const decodedValue = val.replace(/\+/g, ' ');
    queryParts.push(`${paramName}[]=${encodeURIComponent(decodedValue)}`);
  });
};

// Process job titles → personTitles[]
if (paramsData.job_title && Array.isArray(paramsData.job_title)) {
  addArrayParams('personTitles', paramsData.job_title);
}

// Process locations → personLocations[]
if (paramsData.location && Array.isArray(paramsData.location)) {
  addArrayParams('personLocations', paramsData.location);
}

// Process businesses → qOrganizationKeywordTags[]
if (paramsData.business && Array.isArray(paramsData.business)) {
  addArrayParams('qOrganizationKeywordTags', paramsData.business);
}

// Add static included organization keyword fields
queryParts.push('includedOrganizationKeywordFields[]=tags');
queryParts.push('includedOrganizationKeywordFields[]=name');

// Build final URL
const queryString = queryParts.join('&');
const finalURL = `${baseURL}?${queryString}`;

// Return
return [{ json: { finalURL } }];

const profiles = [];

for (const item of $input.all()) {
  const data = item.json;

  // Ensure linkedinURL is present and valid
  const profileUrl = data["linkedinURL"];
  if (!profileUrl || profileUrl.trim() === "") continue;

  // Prepare custom_variables by copying all fields except linkedinURL
  const customVars = {};
  for (const [key, value] of Object.entries(data)) {
    if (key !== "linkedinURL") {
      customVars[key] = value === "" ? null : value;
    }
  }

  // Extract first and last name from fullName
  const fullName = data["fullName"] || "";
  const [firstName, ...rest] = fullName.trim().split(" ");
  const lastName = rest.join(" ");

  customVars["first name"] = firstName || null;
  customVars["last name"] = lastName || null;

  profiles.push({
    profile_url: profileUrl.trim(),
    custom_variables: customVars
  });
}

return [
  {
    json: {
      type: "profile_url",
      profiles
    }
  }
];

